Functions are generally used for computing some value, so they need a mechanism to supply that value back to the caller. # first build it without an explicit return
double.num <- function(x) { x * 2
}
double.num(5) ## [1] 10 # now build it with an explicit return
double.num <- function(x) { return(x * 2)
}
double.num(5) ## [1] 10 double.num <- function(x) { x * 3 print("hello") x * 2
}
double.num(5) ## [1] "hello"
## [1] 10 double.num <- function(x) { return(x * 2) print("hello") return(3)
}
double.num(5) ## [1] 10

